import React from "react";
import NotificationAlert from "react-notification-alert";

// reactstrap components
import {
  Alert,
  UncontrolledAlert,
  Button,
  Card,
  CardHeader,
  CardBody,
  CardTitle,
  Row,
  Col,
} from "reactstrap";

function RiskGrowth() {
  return (
    <>
      <div className="content">
      <Row>
          <Col lg="8">
            <Card>
              <CardHeader>
                <h4 className="title">Coming soon!</h4>
              </CardHeader>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default RiskGrowth;
